import illustration from "../../assets/images/undraw_hello_re_3evm.svg";

const Home = () => {
  return (
    <div className="home">
      <div className="|">Home page</div>
      <div className="illustration"><img src={illustration} alt="illustration" /></div>
    </div>
    );
};

export default Home;
